(2, 0, 0, 0, 0, NULL, 'gioithieu', 0, 0, '1-7295.png', '1-7295_480x320.png', 'Giới thiệu về Công ty TNHH MADE', '', 'gioi-thieu-ve-cong-ty-tnhh-made', '', '', '', 0, 0, 0, 0, '', '<p style=\"margin:0cm 0cm 8pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">&nbsp;CÔNG TY TNHH MADE là công ty phát triển dịch vụ công cộng bao gồm các lĩnh vực sau đây</span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"margin:0cm 0cm 0.0001pt 36pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">Chữ ký số </span></span></span></span></span></span></li>\r\n	<li style=\"margin:0cm 0cm 0.0001pt 36pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">Bảo hiểm điện tử </span></span></span></span></span></span></li>\r\n	<li style=\"margin:0cm 0cm 0.0001pt 36pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">Hải quan điện tử</span></span></span></span></span></span></li>\r\n	<li style=\"margin:0cm 0cm 0.0001pt 36pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">Hóa đơn điện tử</span></span></span></span></span></span></li>\r\n	<li style=\"margin:0cm 0cm 8pt 36pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">Tư vấn phát triễn thành lập doanh nghiệp </span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin-left:18.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">Đến nay đã triển khai và hỗ trợ hàng nghìn doanh nghiệp tại Việt Nam...&nbsp;&nbsp;Hiện tại Chúng tôi là đầu mối cung cấp các chữ ký số lớn và phần mềm uy tín hàng đầu Việt Nam như FPT-CA , VIETTEL-CA , VINA-CA, EFY, ……………</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:18.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\">&nbsp; <strong><span style=\"background:white\"><span arial=\"\"><span style=\"color:#333333\">CÔNG TY TNHH MADE</span></span></span></strong><strong>&nbsp;</strong><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">được ra đời bởi một mục đích duy nhất là hỗ trợ kiệp thời cho doanh nghiệp ,với đội ngủ giỏi chuyên môn nghiệp vụ , MADE hoạt động với mục tiêu hỗ trợ tối đa cho các doanh nghiệp nộp các loại tờ tới các cổng nhà nước một cách nhanh chóng và thuận tiện nhất. Sử dụng dịch vụ hỗ trợ và cung cấp bởi</span></span></span><span style=\"background:white\"><span arial=\"\"><span style=\"color:#333333\"> MADE</span></span></span><strong>&nbsp;</strong><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">giúp giảm thiểu rủi ro trong thương mại điện tử nhờ đặc điểm toàn vẹn dữ liệu, an ninh. </span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:18.0pt; margin:0cm 0cm 8pt\"><br />\r\n<span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><strong><span style=\"background:#f1f7fe\"><span style=\"line-height:107%\"><span arial=\"\"><span style=\"color:black\">Các dịch vụ của MADE </span></span></span></span></strong></span></span></span></p>\r\n\r\n<p style=\"margin-left:18.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><strong><span style=\"background:white\"><span arial=\"\"><span style=\"color:#333333\">Chữ ký số </span></span></span></strong><span style=\"line-height:107%\"><span tahoma=\"\"><span style=\"color:black\">-&nbsp;</span></span></span><a href=\"https://chukyso24h.vn/\" style=\"color:blue; text-decoration:underline\"><b><span style=\"line-height:107%\"><span tahoma=\"\"><span style=\"color:black\">Chữ ký số</span></span></span></b><b>&nbsp;</b></a><span style=\"line-height:107%\"><span tahoma=\"\"><span style=\"color:black\">dựa trên công nghệ mã khóa công khai (RSA):&nbsp; mỗi người dùng phải có 1 cặp khóa (keypair) gồm khóa công khai (public key) và khóa bí mật (private key).</span></span></span><br />\r\n<br />\r\n<span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">&nbsp;- Cung cấp&nbsp;</span></span></span><a href=\"https://chukyso24h.vn/tag/chu-ky-so.html\" style=\"color:blue; text-decoration:underline\"><span arial=\"\"><span style=\"color:black\">chữ ký số</span></span></a><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">&nbsp;cho cá nhân, tổ chức, doanh nghiệp.<br />\r\n&nbsp;- Dịch vụ hỗ trợ sửa lỗi trong quá trình nộp tờ&nbsp;</span></span></span><a href=\"https://chukyso24h.vn/tag/khai-thue-qua-mang.html\" style=\"color:blue; text-decoration:underline\"><span arial=\"\"><span style=\"color:black\">khai thuế qua mạng</span></span></a><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">. Chăm sóc và giải đáp thắc mắc của khách hàng.</span></span></span></span></span></span><br />\r\n&nbsp;</p>\r\n\r\n<p style=\"margin-left:18.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><strong><span style=\"background:white\"><span arial=\"\"><span style=\"color:#333333\">Hóa đơn điện tử </span></span></span></strong></span></span></span></p>\r\n\r\n<p style=\"margin-left:18.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><strong><span style=\"background:white\"><span style=\"line-height:107%\"><span arial=\"\"><span style=\"color:#333333\">Hóa đơn điện tử</span></span></span></span></strong><span style=\"background:white\"><span style=\"line-height:107%\"><span arial=\"\"><span style=\"color:#333333\">&nbsp;là hình thức hóa đơn được tạo lập trên thiết bị điện tử ( theo đúng quy định của Bộ Tài Chính và Cơ Quan Thuế). Sử dụng hóa đơn điện tử sẽ giúp bạn thanh toán thuận tiện và nhanh chóng khi mua hàng hoặc trả hóa đơn. Đồng thời bảo mật và lưu trữ, tra cứu rất dễ dàng.&nbsp;</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:18.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><strong><span style=\"background:white\"><span style=\"line-height:107%\"><span arial=\"\"><span style=\"color:#333333\">Bảo hiểm điện tử </span></span></span></span></strong></span></span></span></p>\r\n\r\n<h2 style=\"margin:0cm; margin-bottom:.0001pt; text-align:justify; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"background:white\"><span style=\"vertical-align:baseline\"><span new=\"\" roman=\"\" times=\"\"><span style=\"border: 1pt none windowtext; padding: 0cm;\"><span arial=\"\"><span style=\"color:#222222\"><span style=\"font-weight:normal\">Bảo hiểm xã hội điện tử là một phần mềm hỗ trợ cho doanh nghiệp kê khai bảo hiểm xã hội ngay tại nơi làm việc của mình, trên máy tính của kế toán. Phần mềm này ra đời với mục đích đáp ứng nhu cầu kê khai, thủ tục nhanh chóng của mọi doanh nghiệp để tiết kiệm chi phí giao dịch, chi phí nhân sự thực hiện các thủ tục hành chính</span></span></span></span><span style=\"border: 1pt none windowtext; padding: 0cm;\"><span arial=\"\"><span style=\"color:#222222\">.</span></span></span></span></span></span></span></span></h2>\r\n\r\n<h2 style=\"margin:0cm; margin-bottom:.0001pt; text-align:justify; margin-right:0cm; margin-left:0cm\"><br />\r\n<span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><strong><span style=\"background:#f1f7fe\"><span style=\"line-height:107%\"><span arial=\"\"><span style=\"color:black\">Đối tượng sử dụng dịch vụ </span></span></span></span></strong><br />\r\n<span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">&nbsp;- Các doanh nghiệp: sử dụng dịch vụ nộp tờ&nbsp;</span></span></span><a href=\"https://chukyso24h.vn/tag/khai-thue-qua-mang.html\" style=\"color:blue; text-decoration:underline\"><span arial=\"\"><span style=\"color:black\">khai thuế qua mạng</span></span></a><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">, khai&nbsp;</span></span></span><a href=\"https://chukyso24h.vn/tag/hai-quan.html\" style=\"color:blue; text-decoration:underline\"><span arial=\"\"><span style=\"color:black\">hải quan</span></span></a><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">&nbsp;điện tử, hóa đơn điện tử...<br />\r\n&nbsp;- Các cá nhân: Ký văn bản word, Excel, PDF...</span></span></span><br />\r\n<br />\r\n<strong><span style=\"background:#f1f7fe\"><span style=\"line-height:107%\"><span arial=\"\"><span style=\"color:black\">Lợi ích khi sử dụng dịch vụ của MADE</span></span></span></span></strong></span></span></span></h2>\r\n\r\n<p style=\"margin-left:18.0pt; margin:0cm 0cm 8pt\"><span style=\"font-size:20px;\"><span style=\"font-family:Times New Roman,Times,serif;\"><span style=\"line-height:107%\"><strong>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong><br />\r\n<span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">- Tiết kiệm chi phí tối đa cho khách hàng: Khách hàng có thể nộp tờ khai mọi lúc, mọi nơi chỉ cần có mạng internet, máy tính và thiết bị USB Token. Khách hàng sẽ không phải mất công đi lại, xếp hàng tại cơ quan thuế để nộp tờ khai. Ngoài ra còn giúp tiết kiệm chi phí in sao hồ sơ, giảm thiểu sai sót trong quá trình kê và tờ khai.<br />\r\n- Được hỗ trợ 24/7 bởi những kỹ thuật viên giàu kinh nghiệm, nhiệt tình, am hiểu kĩ thuật nghiệp vụ và làm việc có trách nhiệm.&nbsp;<br />\r\n- Hoàn toàn yên tâm sử dụng: chữ ký số do chúng tôi cung cấp được pháp luật Việt Nam công nhận và bảo vệ, được khoa học thực tiễn kiểm chứng về độ an toàn bảo mật.</span></span></span><br />\r\n<br />\r\n<strong><span style=\"background:#f1f7fe\"><span style=\"line-height:107%\"><span arial=\"\"><span style=\"color:black\">Mục tiêu phát triển &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span></span></span></strong><br />\r\n&nbsp; &nbsp; &nbsp;<span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">Trong lộ trình phát triển sản phẩm dịch vụ của mình, made luôn trân trọng các quan hệ đối tác và hợp tác kinh doanh luôn mong muốn liên kết mở rộng các mạng lưới tư vấn, đại lý, các điểm bán hàng, các cộng tác viên... để cùng với chúng tôi cung cấp và xã hội hoá dịch vụ chứng thực chữ ký số công cộng góp phần phổ biến dịch vụ&nbsp;</span></span></span><a href=\"https://chukyso24h.vn/tag/khai-thue.html\" style=\"color:blue; text-decoration:underline\"><span arial=\"\"><span style=\"color:black\">khai thuế</span></span></a><span style=\"background:white\"><span arial=\"\"><span style=\"color:black\">&nbsp;qua mạng, khai hải quan điện tử, chữ ký số&nbsp;cá nhân. giao dịch chứng khoán, ngân hàng và các giao dịch điện tử khác.&nbsp; đã xây dựng các chính sách và quy chế hợp tác để cùng các bạn đồng hành với chúng tôi trong suốt chặng đường phát triển bền vững.</span></span></span></span></span></span><br />\r\n<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p style=\"margin:0cm 0cm 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin:0cm 0cm 8pt\">&nbsp;</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1553568405, 1556970830, 261, '', '', '', '', '', '', '', '', '0', '0', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
