(12, 2, 1, 0, 0, NULL, 'duan', 1, 0, 'estateflowersgardenvegetationyard603882560x1024-6045.jpg', 'estateflowersgardenvegetationyard603882560x1024-6045_280x170.jpg', 'Lorem Ipsum là gì?', '', 'lorem-ipsum-la-gi', '', '', '', 0, 0, 0, 0, 'Lorem Ipsum chỉ đơn giản là một đoạn văn bản giả, được dùng vào việc trình bày và dàn trang phục vụ cho in ấn. Lorem Ipsum đã được sử dụng như một văn bản chuẩn cho ngành công nghiệp in ấn từ những năm 1500, khi một họa sĩ vô danh ghép nhiều đoạn văn bản với nhau để tạo thành một bản mẫu văn bản. Đoạn văn bản này không những đã tồn tại năm thế kỉ, mà khi được áp dụng vào tin học văn phòng, nội dung của nó vẫn không hề bị thay đổi. Nó đã được phổ biến trong những năm 1960 nhờ việc bán những bản giấy Letraset in những đoạn Lorem Ipsum, và gần đây hơn, được sử dụng trong các ứng dụng dàn trang, như Aldus PageMaker.\r\n\r\n', '<h1><strong>SUNSHINE CITY SAI GON - NGHỆ THUẬT SỐNG THƯỢNG LƯU</strong></h1>\r\n\r\n<h1><strong>TUYỆT TÁC MỚI CỦA SUNSHINE GROUP</strong></h1>\r\n\r\n<p><strong><img alt=\"\" src=\"http://diaochcm.org/uploadimages/phoi-canh-sunshine-city.jpg\" /></strong></p>\r\n\r\n<p><strong>TINH HOA CHÂU ÂU, KHỞI ĐẦU THỊNH VƯỢNG</strong></p>\r\n\r\n<p>Lấy cảm hứng từ dòng sông Hudson của New York phồn hoa, Sunshine City được xây dựng bên dòng sông Cả Cấm tại bờ Nam thành phố, nơi hưởng trọn sinh khí thịnh vượng từ dòng chảy tài lộc xanh mát và trong lành, mặt kia nhìn về sông Sài Gòn trải dài miên man.</p>\r\n\r\n<p><strong>Sunshine City</strong>&nbsp;<strong>Sài Gòn</strong>&nbsp;biết chọn cho mình một chỗ&nbsp;đứng lý tưởng, nơi những doanh nhân thành đạt hàng ngày phải đối mặt với bao căng thẳng luôn khao khát sở hữu. Tránh xa những bộn bề của cuộc sống nhộn nhịp, quên&nbsp;đi những lo toan và thả mình vào không gian sống đẳng cấp xa hoa mà chủ đầu tư Sunshine Group kiến tạo, Sunshine City Sài Gòn hứa hẹn sẽ là dự&nbsp;án&nbsp;được quan tâm và yêu thích của những đấng anh tài.</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1553747571, 1553747920, 2, 'NGUYỄN THỊNH VƯỢNG', 'LÊ BÁ TRÚC', '', '', '<p><img alt=\"\" src=\"http://diaochcm.org/uploadimages/%E1%BA%A2nh%20ch%E1%BB%A5p%20M%C3%A0n%20h%C3%ACnh%202018-12-07%20l%C3%BAc%2022_41_04.png\" /></p>\r\n', '', '', '', '0', '1,500 tỷ đồng', '', 0, '', '', '', '', '', '<p>Được tư vấn thiết kế bởi đội ngũ kiến trúc sư chuyên nghiệp,&nbsp;<strong>Sunshine City Sài Gòn</strong>&nbsp;là sự giao hòa của không gian sống và các dịch vụ, tiện ích thương mại, nơi những giá trị tinh hoa nâng tầm đẳng cấp cho chuẩn mực sống thượng lưu.</p>\r\n\r\n<p>Đẳng cấp thượng lưu thể hiện trong những chi tiết nhấn nhá đầy dụng ý của thiết kế, sự tỉ mỉ, tinh tế của nội thất cao cấp mạ vàng đến từ những thương hiệu lừng danh thế giới.</p>\r\n\r\n<p>Một sự xa hoa xứng đáng dành cho những chủ nhân đích thực, nơi căn hộ không chỉ là tổ ấm, mà còn là một chỉ dấu của cuộc sống thành đạt, vương giả.</p>\r\n\r\n<p><strong>Sunshine City Sài Gòn&nbsp;</strong>là dự án đầu tiên tại TP.HCM áp&nbsp;dụng nền công nghiệp 4.0.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '<p>Với tiện ích lớn dành cho không gian cảnh quan và tiện ích, Sunshine City Sài Gòn là xứ sở của cuộc sống hiện đại, dẫn đầu xu hướng tương lai. Dịch vụ chuẩn 5 sao quốc tế cùng hệ thống quản lý – vận hành ứng dụng công nghệ thông minh được khai thác hoàn hảo tại Sunshine City, nơi hội tụ trọn vẹn của những chuẩn mực giá trị sống.</p>\r\n\r\n<p>Một khu đô thị sở hữu mọi tiện ích tinh hoa, một cuộc sống như mơ trải nghiệm chất thượng lưu đẳng cấp,...tất cả sẽ được hiện diện tại Sunshine City SaiGon:</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Sân chơi thể thao đa năng</p>\r\n\r\n			<p>Hồ cảnh quan</p>\r\n\r\n			<p>Sảnh lounge đón khách</p>\r\n\r\n			<p>Hầm để xe liên tòa</p>\r\n\r\n			<p>Bể bơi vô cực</p>\r\n\r\n			<p>Thư viện</p>\r\n\r\n			<p>Thác tràn nghệ thuật</p>\r\n\r\n			<p>Rooftop City Bar</p>\r\n			</td>\r\n			<td>\r\n			<p>Trường mầm non Maple Bear</p>\r\n\r\n			<p>Nhà hàng Á - Âu</p>\r\n\r\n			<p>S - Mart,&nbsp;S - Cafe</p>\r\n\r\n			<p>S - Fitness and Spa</p>\r\n\r\n			<p>Khu vui chơi trẻ em</p>\r\n\r\n			<p>Vườn nướng BBQ</p>\r\n\r\n			<p>Cầu đi bộ liên tòa</p>\r\n\r\n			<p>Vườn cây bốn mùa</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img src=\"http://diaochcm.org/uploadimages/banner-4-4.jpg\" />​​​​​​</p>\r\n', '', '', NULL),
