553747571, 1553747920, 0, 'NGUYỄN THỊNH VƯỢNG', 'LÊ BÁ TRÚC', '', '', '<p><img alt=\"\" src=\"http://diaochcm.org/uploadimages/%E1%BA%A2nh%20ch%E1%BB%A5p%20M%C3%A0n%20h%C3%ACnh%202018-12-07%20l%C3%BAc%2022_41_04.png\" /></p>\r\n', '', '', '', '0', '1,500 tỷ đồng', '', 0, '', '', '', '', '', '<p>Được tư vấn thiết kế bởi đội ngũ kiến trúc sư chuyên nghiệp,&nbsp;<strong>Sunshine City Sài Gòn</strong>&nbsp;là sự giao hòa của không gian sống và các dịch vụ, tiện ích thương mại, nơi những giá trị tinh hoa nâng tầm đẳng cấp cho chuẩn mực sống thượng lưu.</p>\r\n\r\n<p>Đẳng cấp thượng lưu thể hiện trong những chi tiết nhấn nhá đầy dụng ý của thiết kế, sự tỉ mỉ, tinh tế của nội thất cao cấp mạ vàng đến từ những thương hiệu lừng danh thế giới.</p>\r\n\r\n<p>Một sự xa hoa xứng đáng dành cho những chủ nhân đích thực, nơi căn hộ không chỉ là tổ ấm, mà còn là một chỉ dấu của cuộc sống thành đạt, vương giả.</p>\r\n\r\n<p><strong>Sunshine City Sài Gòn&nbsp;</strong>là dự án đầu tiên tại TP.HCM áp&nbsp;dụng nền công nghiệp 4.0.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '<p>Với tiện ích lớn dành cho không gian cảnh quan và tiện ích, Sunshine City Sài Gòn là xứ sở của cuộc sống hiện đại, dẫn đầu xu hướng tương lai. Dịch vụ chuẩn 5 sao quốc tế cùng hệ thống quản lý – vận hành ứng dụng công nghệ thông minh được khai thác hoàn hảo tại Sunshine City, nơi hội tụ trọn vẹn của những chuẩn mực giá trị sống.</p>\r\n\r\n<p>Một khu đô thị sở hữu mọi tiện ích tinh hoa, một cuộc sống như mơ trải nghiệm chất thượng lưu đẳng cấp,...tất cả sẽ được hiện diện tại Sunshine City SaiGon:</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Sân chơi thể thao đa năng</p>\r\n\r\n			<p>Hồ cảnh quan</p>\r\n\r\n			<p>Sảnh lounge đón khách</p>\r\n\r\n			<p>Hầm để xe liên tòa</p>\r\n\r\n			<p>Bể bơi vô cực</p>\r\n\r\n			<p>Thư viện</p>\r\n\r\n			<p>Thác tràn nghệ thuật</p>\r\n\r\n			<p>Rooftop City Bar</p>\r\n			</td>\r\n			<td>\r\n			<p>Trường mầm non Maple Bear</p>\r\n\r\n			<p>Nhà hàng Á - Âu</p>\r\n\r\n			<p>S - Mart,&nbsp;S - Cafe</p>\r\n\r\n			<p>S - Fitness and Spa</p>\r\n\r\n			<p>Khu vui chơi trẻ em</p>\r\n\r\n			<p>Vườn nướng BBQ</p>\r\n\r\n			<p>Cầu đi bộ liên tòa</p>\r\n\r\n			<p>Vườn cây bốn mùa</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img src=\"http://diaochcm.org/uploadimages/banner-4-4.jpg\" />​​​​​​</p>\r\n', '', '', NULL),
