(18, 2, 1, 0, 0, NULL, 'duan', 1, 0, 'estateflowersgardenvegetationyard603882560x1024-6045.jpg', 'estateflowersgardenvegetationyard603882560x1024-6045_280x170.jpg', 'Lorem Ipsum là gì?', '', 'lorem-ipsum-la-gi', '', '', '', 0, 0, 0, 0, 'Lorem Ipsum chỉ đơn giản là một đoạn văn bản giả, được dùng vào việc trình bày và dàn trang phục vụ cho in ấn. Lorem Ipsum đã được sử dụng như một văn bản chuẩn cho ngành công nghiệp in ấn từ những năm 1500, khi một họa sĩ vô danh ghép nhiều đoạn văn bản với nhau để tạo thành một bản mẫu văn bản. Đoạn văn bản này không những đã tồn tại năm thế kỉ, mà khi được áp dụng vào tin học văn phòng, nội dung của nó vẫn không hề bị thay đổi. Nó đã được phổ biến trong những năm 1960 nhờ việc bán những bản giấy Letraset in những đoạn Lorem Ipsum, và gần đây hơn, được sử dụng trong các ứng dụng dàn trang, như Aldus PageMaker.\r\n\r\n', '<h1><strong>SUNSHINE CITY SAI GON - NGHỆ THUẬT SỐNG THƯỢNG LƯU</strong></h1>\r\n\r\n<h1><strong>TUYỆT TÁC MỚI CỦA SUNSHINE GROUP</strong></h1>\r\n\r\n<p><strong><img alt=\"\" src=\"http://diaochcm.org/uploadimages/phoi-canh-sunshine-city.jpg\" /></strong></p>\r\n\r\n<p><strong>TINH HOA CHÂU ÂU, KHỞI ĐẦU THỊNH VƯỢNG</strong></p>\r\n\r\n<p>Lấy cảm hứng từ dòng sông Hudson của New York phồn hoa, Sunshine City được xây dựng bên dòng sông Cả Cấm tại bờ Nam thành phố, nơi hưởng trọn sinh khí thịnh vượng từ dòng chảy tài lộc xanh mát và trong lành, mặt kia nhìn về sông Sài Gòn trải dài miên man.</p>\r\n\r\n<p><strong>Sunshine City</strong>&nbsp;<strong>Sài Gòn</strong>&nbsp;biết chọn cho mình một chỗ&nbsp;đứng lý tưởng, nơi những doanh nhân thành đạt hàng ngày phải đối mặt với bao căng thẳng luôn khao khát sở hữu. Tránh xa những bộn bề của cuộc sống nhộn nhịp, quên&nbsp;đi những lo toan và thả mình vào không gian sống đẳng cấp xa hoa mà chủ đầu tư Sunshine Group kiến tạo, Sunshine City Sài Gòn hứa hẹn sẽ là dự&nbsp;án&nbsp;được quan tâm và yêu thích của những đấng anh tài.</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1