(24, 0, 0, 0, 0, NULL, 'visao', 0, 0, '', '', 'Hỗ trợ trợ nhiệt tình', '', 'ho-tro-tro-nhiet-tinh', '', '', '', 0, 0, 0, 0, 'Đội ngũ kỹ thuật viên của chúng tôi luôn thường trực 24/7 để hỗ trợ bạn khắc phục các sự cố xảy ra và đưa nó trở lại hoạt động bình thường trong thời gian ngắn nhất có thể.\r\n\r\n', '', '', '', '', '', '', '', '', '', 4, 1, 1556785739, 1556873537, 0, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
(25, 0, 0, 0, 0, NULL, 'visao', 0, 0, '', '', ' Giá cả hợp lý ', '', 'gia-ca-hop-ly', '', '', '', 0, 0, 0, 0, 'Các dịch vụ của chúng tôi được thiết kế để đáp ứng các yêu cầu khác nhau của Khách hàng và cân nhắc đến các tình huống, hoàn cảnh khác nhau.', '', '', '', '', '', '', '', '', '', 3, 1, 1556785748, 1556873505, 0, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
(26, 0, 0, 0, 0, NULL, 'visao', 0, 0, '', '', 'Sự hài lòng của khách hàng là ưu tiên số 1 ', '', 'su-hai-long-cua-khach-hang-la-uu-tien-so-1', '', '', '', 0, 0, 0, 0, 'Chúng tôi luôn coi “sự hài lòng của khách hàng” là mục tiêu phấn đấu của công ty chúng tôi. Đó là vì sao chúng tôi luôn coi trọng sự kết nối và mối quan hệ bền vững với khách hàng.', '', '', '', '', '', '', '', '', '', 1, 1, 1556785755, 1556873460, 0, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
(34, 0, 0, 0, 0, NULL, 'visao', 0, 0, '', '', 'Dịch Vụ Cung Cấp Nhanh Nhất ', '', 'dich-vu-cung-cap-nhanh-nhat', '', '', '', 0, 0, 0, 0, 'Chúng tôi luôn đảm bảo tiến độ cung cấp dịch vụ nhanh chóng, chính xác và đầy đủ đến khách hàng ', '', '', '', '', '', '', '', '', '', 2, 1, 1556873419, 1556873582, 0, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
(76, 0, 0, 0, 0, NULL, 'tintuc', 1, 0, 'kt-9991.jpg', 'kt-9991_280x170.jpg', 'VI PHẠM HÀNH CHÍNH TRONG LĨNH VỰC KẾ TOÁN PHẠT ĐẾN 100 TRIỆU ĐỒNG', '', 'vi-pham-hanh-chinh-trong-linh-vuc-ke-toan-phat-den-100-trieu-dong', '', '', '', 0, 0, 0, 0, 'Phạt tiền từ 5-10 triệu đồng đối với một trong các hành vi sau: Lập chứng từ kế toán không đủ số liên theo quy định của mỗi loại chứng từ kế toán', '<p dir=\"ltr\">Phạt tiền từ 5-10 triệu đồng đối với một trong các hành vi sau:&nbsp;<strong>Lập chứng từ kế toán không đủ số liên theo quy định của mỗi loại chứng từ kế toán</strong>; ký chứng từ kế toán khi chưa ghi đủ nội dung chứng từ thuộc trách nhiệm của người ký; ký chứng từ kế toán mà không đúng thẩm quyền;&nbsp;<strong>chữ ký của một người không thống nhất hoặc không đúng với sổ đăng ký mẫu chữ ký</strong>; chứng từ kế toán không có đủ chữ ký theo chức danh quy định trên chứng từ; không dịch chứng từ kế toán bằng tiếng nước ngoài ra tiếng Việt theo quy định;&nbsp;<strong>để hư hỏng, mất mát tài liệu, chứng từ kế toán đang trong quá trình sử dụng</strong>.</p>\r\n\r\n<p dir=\"ltr\">Phạt tiền từ 20 - 30 triệu đồng đối với một trong các hành vi: Giả mạo, khai man chứng từ kế toán nhưng chưa đến mức truy cứu trách nhiệm hình sự; thỏa thuận hoặc ép buộc người khác giả mạo, khai man chứng từ kế toán nhưng chưa đến mức truy cứu trách nhiệm hình sự; lập chứng từ kế toán có nội dung các liên không giống nhau trong trường hợp phải lập chứng từ kế toán có nhiều liên cho một nghiệp vụ kinh tế, tài chính phát sinh; không lập chứng từ kế toán khi nghiệp vụ kinh tế, tài chính phát sinh; lập nhiều lần chứng từ kế toán cho một nghiệp vụ kinh tế, tài chính phát sinh; thực hiện chi tiền khi chứng từ chi tiền chưa có đầy đủ chữ ký của người có thẩm quyền theo quy định của pháp luật về kế toán.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img height=\"289\" src=\"http://madeco.com.vn/upload/images/image-20190508132148-1.png\" width=\"479\" /></p>\r\n\r\n<p dir=\"ltr\"><strong>Phạt nặng hành vi khai man số liệu báo cáo tài chính</strong></p>\r\n\r\n<p dir=\"ltr\">Nghị định cũng quy định cụ thể mức phạt hành vi vi phạm quy định về lập và trình bày báo cáo tài chính. Cụ thể, phạt tiền từ 5 - 10 triệu đồng đối với một trong các hành vi: Lập báo cáo tài chính không đầy đủ nội dung hoặc không đúng biểu mẫu theo quy định; báo cáo tài chính không có chữ ký của người lập, kế toán trưởng, phụ trách kế toán hoặc người đại diện theo pháp luật của đơn vị kế toán.</p>\r\n\r\n<p dir=\"ltr\">Đối với một trong các hành vi: Lập không đầy đủ các báo cáo tài chính theo quy định; áp dụng mẫu báo cáo tài chính khác với quy định của chuẩn mực và chế độ kế toán trừ trường hợp đã được Bộ Tài chính chấp thuận thì sẽ bị phạt tiền từ 10-20 triệu đồng.</p>\r\n\r\n<p dir=\"ltr\">Phạt tiền từ 20 - 30 triệu đồng đối với một trong các hành vi sau: Không lập báo cáo tài chính theo quy định; lập báo cáo tài chính không đúng với số liệu trên sổ kế toán và chứng từ kế toán; lập và trình bày báo cáo tài chính không tuân thủ đúng chế độ kế toán và chuẩn mực kế toán.</p>\r\n\r\n<p dir=\"ltr\">Phạt tiền từ 40 - 50 triệu đồng đối với một trong các hành vi sau: Giả mạo báo cáo tài chính, khai man số liệu trên báo cáo tài chính nhưng chưa đến mức truy cứu trách nhiệm hình sự; thỏa thuận hoặc ép buộc người khác giả mạo báo cáo tài chính, khai man số liệu trên báo cáo tài chính nhưng chưa đến mức truy cứu trách nhiệm hình sự; cố ý, thỏa thuận hoặc ép buộc người khác cung cấp, xác nhận thông tin, số liệu kế toán sai sự thật nhưng chưa đến mức truy cứu trách nhiệm hình sự.</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1557296600, 1592456772, 83, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
(80, 0, 0, 0, 0, NULL, 'tintuc', 1, 0, 'thue-2686.png', 'thue-2686_280x170.png', 'Tổng cục Thuế tổ chức tập huấn về hóa đơn điện tử và chế độ kế toán cho doanh nghiệp', '', 'tong-cuc-thue-to-chuc-tap-huan-ve-hoa-don-dien-tu-va-che-do-ke-toan-cho-doanh-nghiep', '', '', '', 0, 0, 0, 0, 'Tổng cục Thuế tổ chức tập huấn về hóa đơn điện tử và chế độ kế toán cho doanh nghiệp', '<h3 id=\"title\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Tổng cục Thuế tổ chức tập huấn về hóa đơn điện tử và chế độ kế toán cho doanh nghiệp</span></h3>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">Ngày 08/05/2019</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Nhằm mục đích hỗ trợ các doanh nghiệp siêu nhỏ, đại lý thuế, công ty dịch vụ kế toán, kiểm toán nắm bắt các nội dung mới về chế độ kế toán, quy định về hoá đơn điện tử, hôm nay ngày 8/5/2019 tại Văn phòng Tổng cục Thuế, Tổng cục Thuế phối hợp với Hội tư vấn thuế Việt Nam, Cục Quản lý giám sát Kế toán, kiểm toán – Bộ Tài chính tổ chức tập huấn phổ biến, hướng dẫn chính sách về hoá đơn điện tử quy định tại Nghị định 119/NĐ-CP ngày 13/9/2018 và quy định về kế toán theo Thông tư số 132/2018/TT-BTC ngày 28/12/2018, đồng thời&nbsp; trực tiếp giải đáp các vướng mắc, kiến nghị của doanh nghiệp.</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" src=\"http://www.gdt.gov.vn/wps/wcm/connect/c2b15864-a66a-4990-a872-19dccf298f9f/1/IMG_1557279854126_1557280100399.jpg?MOD=AJPERES&amp;CACHEID=ROOTWORKSPACEc2b15864-a66a-4990-a872-19dccf298f9f/1\" title=\"\" width=\"450\" /></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><em>Ảnh: Toàn cảnh Hội nghị tập huấn</em></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Hội nghị diễn ra trong vòng một ngày với sự tham dự của hơn 500 Doanh nghiệp siêu nhỏ, các Đại lý thuế và các Công ty dịch vụ Kế toán. Ngoài phần hướng dẫn về hóa đơn điện tử và chế độ kế toán, hội nghị còn dành thời gian để các doanh nghiệp tham dự đặt câu hỏi, vướng mắc về hóa đơn điện tử và chế độ kế toán. Các vướng mắc doanh nghiệp tập trung chủ yếu về đối tượng sử dụng hóa đơn điện tử, thời điểm áp dụng hóa đơn điện tử, cách điều chỉnh sai sót đối với hóa đơn điện tử đã lập… Về Kế toán, &nbsp;các vướng mắc tập trung vào đối tượng áp dụng chế độ kế toán cho Doanh nghiệp siêu nhỏ, cách ghi chép, điều chỉnh giữa chi phí tính thuế và chi phí kế toán… Các vướng mắc của các Doanh nghiệp đã được đại diện các Vụ của Tổng cục Thuế, đại diện Cục Quản lý giám sát Kế toán, kiểm toán, đại diện Hội tư vấn Thuế Việt Nam trực tiếp trả lời ngay tại hội nghị.</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" src=\"http://www.gdt.gov.vn/wps/wcm/connect/c2b15864-a66a-4990-a872-19dccf298f9f/2/IMG_20190508_155256.jpg?MOD=AJPERES&amp;CACHEID=ROOTWORKSPACEc2b15864-a66a-4990-a872-19dccf298f9f/2\" title=\"\" width=\"450\" /></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><em>Ảnh: Bàn chủ toạ giải đáp vướng mắc về hoá đơn điện tử tại hội nghị</em></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; Ngày 15/5/2019, tại Hội trường Cục Thuế TP Hồ Chí Minh, Tổng cục Thuế sẽ tiếp tục tổ chức tập huấn về hóa đơn điện tử và chế độ kế toán cho doanh nghiệp tại TP Hồ Chí Minh.</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Một số hình ảnh tại buổi tập huấn:</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" src=\"http://www.gdt.gov.vn/wps/wcm/connect/c2b15864-a66a-4990-a872-19dccf298f9f/3/IMG_20190508_155406.jpg?MOD=AJPERES&amp;CACHEID=ROOTWORKSPACEc2b15864-a66a-4990-a872-19dccf298f9f/3\" title=\"\" width=\"450\" /></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><em>Ảnh: Ông Trịnh Đức Vinh – Phó cục Trưởng Cục QLGS Kế toán, kiểm toán trình bày về chính sách kế toán</em></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" src=\"http://www.gdt.gov.vn/wps/wcm/connect/c2b15864-a66a-4990-a872-19dccf298f9f/4/IMG_1557279846775_1557280100095.jpg?MOD=AJPERES&amp;CACHEID=ROOTWORKSPACEc2b15864-a66a-4990-a872-19dccf298f9f/4\" title=\"\" width=\"450\" /></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><em>Ảnh: Bà Nguyễn Thị Thu Hà - Vụ Chính sách, Tổng cục Thuế trình bày chính sách hoá đơn điện tử</em></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" src=\"http://www.gdt.gov.vn/wps/wcm/connect/c2b15864-a66a-4990-a872-19dccf298f9f/5/IMG_20190508_155240.jpg?MOD=AJPERES&amp;CACHEID=ROOTWORKSPACEc2b15864-a66a-4990-a872-19dccf298f9f/5\" title=\"\" width=\"450\" /></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><em>Ảnh: Bàn chủ toạ giải đáp vướng mắc về chính sách kế toán tại hội nghị</em></span></p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1557391167, 1592456751, 68, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL);
