(46, 0, 0, 0, 0, NULL, 'tintuc', 1, 0, 'nop-thue-dt-7089.png', 'nop-thue-dt-7089_280x170.png', 'Thông báo V/v triển khai dịch vụ Thuế điện tử (eTax services) cho 15 tỉnh/thành phố ', '', 'thong-bao-vv-trien-khai-dich-vu-thue-dien-tu-etax-services-cho-15-tinhthanh-pho', '', '', '', 0, 0, 0, 0, '', '<p>TỔNG CỤC THUẾ THÔNG BÁO Thông báo V/v Chuyển đổi hệ thống iHTKK, NTĐT sang hệ thống mới đối với doanh nghiệp thuộc quản lý của Cơ quan thuế các tỉnh/thành phố: Hà Nội, Tuyên Quang, Hà Nam, Hải Phòng, Nam Định, Ninh Bình, Thái Bình, Vĩnh Phúc, Quảng Ninh, Sơn La, Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình, Đồng Nai Từ 17h30 ngày 4/5/2019 đến 8h ngày 6/5/2019, Tổng cục Thuế dừng hệ thống khai thuế điện tử (iHTKK) và Nộp thuế điện tử (NTĐT) đối với các doanh nghiệp thuộc quản lý của Cơ quan thuế các tỉnh/thành phố: Hà Nội, Tuyên Quang, Hà Nam, Hải Phòng, Nam Định, Ninh Bình, Thái Bình, Vĩnh Phúc, Quảng Ninh, Sơn La, Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình, Đồng Nai để chuyển đổi sang hệ thống mới Dịch vụ thuế điện tử (eTax). Bắt đầu từ 8h ngày 6/5/2019, các doanh nghiệp trên sử dụng hệ thống eTax tại đường dẫn http://thuedientu.gdt.gov.vn thay thế cho hệ thống khai thuế (tại đường dẫn http://nhantokhai.gdt.gov.vn) và nộp thuế (tại đường dẫn http://nopthue.gdt.gov.vn) để thực hiện khai thuế, nộp thuế, hoàn thuế điện tử. Cách đăng nhập và sử dụng dịch vụ trên hệ thống eTax như sau: - Trường hợp người sử dụng đã có mật khẩu của hệ thống Nộp thuế điện tử đã sử dụng trước đó (ví dụ mật khẩu là: 123456) tại website nopthue.gdt.gov.vn, người sử dụng đăng nhập vào eTax bằng tài khoản: MST-QL (ví dụ: 0100231226-QL), nhập mật khẩu (là mật khẩu đăng nhập vào hệ thống Nộp thuế điện tử đã có: 123456) để sử dụng tất cả các dịch vụ: Khai thuế, Hoàn thuế, Nộp thuế, Tra cứu, Quản lý và phân quyền tài khoản, Hỏi đáp. Từ tài khoản này, tùy theo yêu cầu quản lý của doanh nghiệp, người sử dụng có thể tạo, phân quyền cho các tài khoản phụ (phân quyền cho cán bộ quản lý theo chức năng). Cách thức phân quyền chi tiết quý vị có thể xem và tải tại phần hướng dẫn sử dụng ứng dụng. - Trường hợp người sử dụng có mật khẩu của hệ thống Khai thuế điện tử đã sử dụng trước đó tại website nhantokhai.gdt.gov.vn (ví dụ mật khẩu là: 567890), người sử dụng đăng nhập vào eTax bằng tài khoản: MST (ví dụ: 0100231226), nhập mật khẩu (là mật khẩu đăng nhập vào hệ thống Khai thuế điện tử đã có là: 567890) để sử dụng dịch vụ Khai thuế, Hoàn thuế, Tra cứu, Hỏi đáp. Đối với doanh nghiệp lần đầu tiên đăng ký giao dịch điện tử với Cơ quan thuế, thực hiện đăng ký sử dụng dịch vụ trên hệ thống eTax tại chức năng Đăng ký. Chi tiết hướng dẫn đăng nhập và sử dụng Dịch vụ Thuế điện tử tại đây. Lưu ý: Để tránh các lỗi phát sinh do việc lưu Cache và block Java của trình duyệt Web, NNT có thể sử dụng trên trình duyệt Chrome (quý vị vui lòng xem tài liệu hướng dẫn để thực hiện). Trân trọng cảm ơn ./.</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1556979265, 1557194110, 82, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
