(182, 0, 0, 0, 0, NULL, 'khachhang', 1, 0, 'kingcoffe-9794.jpg', 'kingcoffe-9794_220x100.jpg', 'Cung Cấp Phần Mềm chữ ký số cho Hệ Thống Công Ty TNI KING COFFEE', '', 'cung-cap-phan-mem-chu-ky-so-cho-he-thong-cong-ty-tni-king-coffee', '', '', '', 0, 0, 0, 0, '', '<p>Nhằm đáp ứng yêu cầu giao dịch điện tử.Công Ty TNI KING COFFE đã yêu cầu Công TY TNHH MADE cung cấp Chữ ký số cho toàn bộ chuỗi hệ thống King Coffe</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1597375380, 0, 5, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', ''),
