(185, 0, 0, 0, 0, NULL, 'tintuc', 1, 0, 'bhxh-973.jpg', 'bhxh-973_280x170.jpg', 'D02-LT Báo cáo tình hình SDLĐ và DS tham gia BHXH, BHYT, BHTN theo Quyết định 1040/QĐ-BHXH', '', 'd02lt-bao-cao-tinh-hinh-sdld-va-ds-tham-gia-bhxh-bhyt-bhtn-theo-quyet-dinh-1040qdbhxh', '', '', '', 0, 0, 0, 0, '', '<p><strong>D02-LT Báo cáo tình hình SDLĐ và DS tham gia BHXH, BHYT, BHTN theo Quyết định 1040/QĐ-BHXH</strong></p>\r\n\r\n<p><strong>Tải về&nbsp;</strong><a href=\"https://www.baohiemxahoidientu.vn/main/download/getckfinderimage?path=/files/D02-LT%20theo%201040.xlsx\"><b>Mẫu D02-LT</b></a></p>\r\n\r\n<p align=\"center\"><b>HƯỚNG DẪN LẬP</b></p>\r\n\r\n<p align=\"center\"><b>Báo cáo tình hình sử dụng lao động và danh sách tham gia BHXH, BHYT, BHTN (Mẫu D02-LT)</b></p>\r\n\r\n<p>a) Mục đích: để đơn vị, doanh nghiệp đăng ký; truy thu, điều chỉnh đóng BHXH, BHYT, BHTN, BHTNLĐ, BNN; cấp sổ BHXH, thẻ BHYT và khai báo tình hình sử dụng lao động đối với người lao động thuộc đơn vị.</p>\r\n\r\n<p>b) Trách nhiệm lập: đơn vị sử dụng lao động.</p>\r\n\r\n<p>c) Thời gian lập: khi có phát sinh về lao động, tiền lương và truy thu đối với người lao động thuộc đơn vị.</p>\r\n\r\n<p>d) Căn cứ lập</p>\r\n\r\n<p>- Tờ khai tham gia BHXH, BHYT (Mẫu TK1-TS);</p>\r\n\r\n<p>- HĐLĐ, HĐLV, quyết định tuyển dụng, tiếp nhận; quyết định nâng lương, thuyên chuyển</p>\r\n\r\n<p>- Hồ sơ khác có liên quan.</p>\r\n\r\n<p>đ) Phương pháp lập</p>\r\n\r\n<p><img alt=\"Báo cáo tình hình sử dụng lao động\" src=\"https://www.baohiemxahoidientu.vn/main/download/getckfinderimage?path=/files/Bao-cao-tinh-hinh-su-dung-lao-dong.jpg\" /></p>\r\n\r\n<p><em>Mẫu báo cáo tình hình sử dụng lao động và danh sách tham gia BHXH, BHYT, BHTN</em></p>\r\n\r\n<p>* Phần thông tin chung</p>\r\n\r\n<p>- Tên đơn vị: ghi đầy đủ tên đơn vị theo đăng ký kinh doanh, quyết định thành lập.</p>\r\n\r\n<p>- Mã đơn vị: ghi mã đơn vị do cơ quan BHXH cấp.</p>\r\n\r\n<p>- Mã số thuế: ghi mã số thuế do cơ quan thuế cấp.</p>\r\n\r\n<p>- Địa chỉ: ghi địa chỉ nơi đóng trụ sở của đơn vị.</p>\r\n\r\n<p>- Điện thoại: ghi số điện thoại của đơn vị.</p>\r\n\r\n<p>- Email: ghi tên email của đơn vị.</p>\r\n\r\n<p>* Chỉ tiêu theo cột:</p>\r\n\r\n<p>- Cột (1): Ghi số thứ tự từ nhỏ đến lớn.</p>\r\n\r\n<p>- Cột (2): Ghi rõ họ, tên của từng người lao động</p>\r\n\r\n<p>Đối với những đơn vị có số lượng người tham gia BHYT lớn, có yêu cầu phân nhóm đối tượng để thuận tiện trong việc tiếp nhận và trả thẻ BHYT, cơ quan BHXH có trách nhiệm hướng dẫn các đơn vị khi lập danh sách cấp thẻ BHYT, tại cột (2) tách thành các nhóm theo mã đơn vị trực thuộc (nhóm và mã đơn vị trực thuộc do đơn vị tự xây dựng nhưng tối đa không quá 6 ký tự được ký hiệu bằng số hoặc bằng chữ).</p>\r\n\r\n<p>Ví dụ: Công ty A có 02 phân xưởng trực thuộc, mỗi phân xưởng có 50 lao động thì Công ty A khi lập danh sách phân thành 02 nhóm: Phân xưởng 1, mã số 01, kèm theo danh sách của 50 lao động thuộc Phân xưởng 1; tiếp theo là Phân xưởng 2, mã số 02, kèm theo danh sách 50 lao động của Phân xưởng 2 (mã số đơn vị trực thuộc có thể là 01, 02 hoặc AA, AB hoặc nhiều ký tự hơn nhưng không quá 6 ký tự).</p>\r\n\r\n<p>- Cột (3):&nbsp;Ghi mã số đối với người&nbsp;người đã có mã số BHXH.</p>\r\n\r\n<p>- Cột (4): Ghi đầy đủ ngày, tháng, năm sinh như trong giấy khai sinh hoặc chứng minh nhân dân/căn cước công dân/hộ chiếu.</p>\r\n\r\n<p>- Cột (5): Ghi giới tính của người tham gia (nếu là nam thì ghi từ “nam” hoặc nếu là nữ thì ghi từ “nữ”).</p>\r\n\r\n<p>- Cột (6): Ghi số căn cước công dân /chứng minh nhân dân/hộ chiếu của người tham gia được cơ quan có thẩm quyền cấp (Riêng hộ chiếu chỉ dành cho người nước ngoài).</p>\r\n\r\n<p>- Cột (7): Ghi đầy đủ, chi tiết về cấp bậc, chức vụ, chức danh nghề, công việc, điều kiện nơi làm việc theo quyết định hoặc HĐLĐ, HĐLV (Ví dụ: Phó Chánh thanh tra Sở A, công nhân vận hành máy may công nghiệp Công ty B ...).</p>\r\n\r\n<p>- Các Cột (8), (9), (10), (11): Phân loại theo: nhà quản lý; chuyên môn kỹ thuật bậc cao; chuyên môn kỹ thuật bậc trung; nhân viên trợ lý văn phòng; nhân viên dịch vụ và bán hàng; lao động có kỹ năng trong nông nghiệp, lâm nghiệp và thủy sản; thợ thủ công; thợ vận hành và lắp ráp máy móc thiết bị; lao động giản đơn.</p>\r\n\r\n<p>- Cột (12): Ghi tiền lương được hưởng:</p>\r\n\r\n<p>+ Người lao động thực hiện chế độ tiền lương do Nhà nước quy định thì ghi bằng hệ số (bao gồm cả hệ số chênh lệch bảo lưu nếu có).</p>\r\n\r\n<p>Ví dụ: Tiền lương ghi trong quyết định tuyển dụng hoặc HĐLV là 2,34 thì ghi 2,34.</p>\r\n\r\n<p>+ Người lao động thực hiện chế độ tiền lương do chủ sử dụng lao động quyết định thì ghi mức lương theo công việc hoặc chức danh, bằng tiền đồng Việt Nam.</p>\r\n\r\n<p>Ví dụ: mức lương của người lao động là 52.000.000 đồng thì ghi 52.000.000 đồng.</p>\r\n\r\n<p>- Các Cột: (13), (14), (15): Ghi phụ cấp chức vụ&nbsp;bằng hệ số; phụ cấp thâm niên vượt khung, thâm niên nghề bằng tỷ lệ phần trăm (%) vào cột tương ứng, nếu không hưởng phụ cấp nào thì bỏ trống.</p>\r\n\r\n<p>- Cột (16): Ghi phụ cấp lương&nbsp;theo quy định của pháp luật lao động (nếu có).</p>\r\n\r\n<p>- Cột (17): Ghi các khoản bổ sung khác theo quy định của pháp luật lao động từ ngày 01/01/2018 (nếu có).</p>\r\n\r\n<p>- Cột (18): Ghi ngày, tháng, năm bắt đầu làm việc trong ngành/nghề nặng nhọc, độc hại.</p>\r\n\r\n<p>- Cột (19): Ghi ngày, tháng, năm kết thúc làm việc trong ngành/nghề nặng nhọc, độc hại.</p>\r\n\r\n<p>- Cột (20): Ghi ngày, tháng, năm bắt đầu làm việc theo HĐLĐ không xác định thời hạn.</p>\r\n\r\n<p>- Cột (21): Ghi ngày, tháng, năm bắt đầu có hiệu lực của HĐLĐ xác định thời hạn.</p>\r\n\r\n<p>- Cột (22): Ghi ngày, tháng, năm hết hiệu lực của HĐLĐ xác định thời hạn.</p>\r\n\r\n<p>- Cột (23): Ghi ngày, tháng, năm bắt đầu có hiệu lực của HĐLĐ khác (dưới 1 tháng, thử việc).</p>\r\n\r\n<p>- Cột (24): Ghi ngày, tháng, năm hết hiệu lực của HĐLĐ khác (dưới 1 tháng, thử việc).</p>\r\n\r\n<p>- Cột (25): Ghi ngày, tháng, năm đơn vị bắt đầu đóng BHXH cho người lao động.</p>\r\n\r\n<p>- Cột (26): Ghi ngày, tháng, năm đơn vị kết thúc (dừng) đóng BHXH cho người lao động.</p>\r\n\r\n<p>- Cột (27): ghi số; ngày, tháng, năm của HĐLĐ, HĐLV (ghi rõ thời hạn HĐLĐ, HĐLV từ ngày, tháng, năm đến ngày, tháng, năm) hoặc quyết định (tuyển dụng, tiếp nhận); tạm hoãn HĐLĐ, nghỉ việc không hưởng lương ... ”. Ghi đối tượng được hưởng quyền lợi BHYT cao hơn nếu có giấy tờ chứng minh như: người có công, cựu chiến binh, ....</p>\r\n\r\n<p><b>Lưu ý:</b></p>\r\n\r\n<p>+ Nếu trong tháng đơn vị lập nhiều danh sách lao động đóng BHXH, BHYT, BHTN thì đánh số các danh sách.</p>\r\n\r\n<p>+ Đơn vị kê khai đầy đủ, chính xác tiền lương đóng BHXH, BHYT, BHTN, BHTNLĐ-BNN&nbsp;của từng người lao động theo quy định của pháp luật và&nbsp;chịu trách nhiệm về việc lập hồ sơ; lưu trữ hồ sơ tham gia BHXH, BHYT, BHTN, BHTNLĐ-BNN.</p>\r\n\r\n<p>+ Trường hợp người lao động chỉ tham gia BHTNLĐ, BNN thì ghi vào mục ghi chú (Cột 27) tương tự như trên.</p>\r\n\r\n<p>+ Trường hợp đơn vị báo tăng lao dộng đối với người lao động đã có mã số BHXH, ghi đầy đủ các tiêu thức trên biểu mẫu và ghi nơi đăng ký KCB ban đầu vào cột 27.</p>\r\n\r\n<p>+ Trường hợp đơn vị có nhiều người thay đổi nơi đăng ký KCB ban đầu thì ghi cột (2), cột (3) và ghi nội dung thay đổi nơi đăng ký KCB ban đầu vào cột 27, các cột khác bỏ trống.</p>\r\n\r\n<p>e) Sau khi hoàn tất việc kê khai đơn vị ký, ghi rõ họ tên, đóng dấu.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1598363187, 0, 54, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', ''),
