(22, 'chukyso', 'Phần Mềm Hóa Đơn Điện Tử', '', 1, 'Giải pháp hóa đơn điện tử tối ưu cho khối doanh nghiệp và hiện đã được triển khai thành công cho Phòng Khám Hapypy Baby, BV Chỉnh Hình...', '', '', '', 'phan-mem-hoa-don-dien-tu', '', '', '', '', '', '', 'phan-mem-hoa-don-dien-tu-361.png', 'phan-mem-hoa-don-dien-tu-361_380x250.png', 3, 1, 1594607190, 1597024490, '', '<p>Được phát triển tuân thủ Nghị định 119/2018/NĐ-CP, Thông tư 32/2011/TT-BTC, Thông tư 39/2014/TT-BTC hướng dẫn về khởi tạo, phát hành và sử dụng hóa đơn điện tử khi bán hàng hóa, cung ứng dịch vụ. Việc sử dụng phần mềm Easyinvoice Và&nbsp; Sinvoice mang lại nhiều lợi ích thiết thực cho doanh nghiệp như: giảm chi phí in ấn, lưu trữ và vận chuyển hóa đơn. Hóa đơn được lập trên máy tính, ký số và gửi đến khách hàng bằng phương tiện điện tử như: email, SMS.....</p>\r\n', ''),
(23, 'chukyso', 'Phần mềm Hải quan điện tử', '', 1, 'Giải pháp hải quan điện tử hàng đầu Việt Nam với tính năng quản lý nghiệp vụ thông quan, khai báo dịch vụ công, quản lý, lưu trữ dữ liệu trực tuyến.', '', '', '', 'phan-mem-hai-quan-dien-tu', '', '', '', '', '', '', 'hai-quan-dien-tu-1767.jpg', 'hai-quan-dien-tu-1767_380x250.jpg', 4, 1, 1594607236, 1594743876, '', '<p>Hệ thống <b>&nbsp;</b>được thiết kế theo chuẩn mực của Hệ thống Hải quan điện tử hiện đại, đáp ứng đầy đủ các quy trình nghiệp vụ của hệ thống VNACCS/VCIS do Hải quan Nhật Bản tài trợ. Mở rộng các thủ tục đăng ký như thủ tục đăng ký danh mục miễn thuế, thủ tục áp dụng chung cả hàng mậu dịch và phi mậu dịch, thủ tục đơn giản đối với hàng hóa trị giá thấp, quản lý hàng hóa tạm nhập, tái xuất. Đồng thời vẫn hỗ trợ đầy đủ các chức năng khai báo đến hệ thống tiếp nhận tập trung, chuẩn thông điệp kết nối được cập nhật liên tục theo thông tư ban hành mới nhất.</p>\r\n', '');
